import React from 'react'
const PriceCard = ({ data }) => {
    return ( 
    <div className="w3-center">
        <b>{data.heading}</b>
        <p  style={{
                    marginTop:0
                }}>Unlock now</p>
        <button
                type="button"
                className="w3-button w3-round-xxlarge w3-text-white"
                style={{
                    width:'100%',
                    margin:0,
                    backgroundColor: 'orange'
                }}
              >
                <b>Rs.199</b>
              </button>
    </div> );
}

export default PriceCard;
